  })
  .then(({ data }) => {
    return data;
  });
  return (
    <div className="App">
        <Header />
        <Switch>
          <Route path="/" exact component={LoginPage} />
          <Route path="/home"  component={DisplayQuotes} />
        </Switch>
    </div>
  );
}

export default App;

